    false,nt"url": null,nt"notes": "The purpose of this grid dataset is to
    provide a broad-scale view of relative zones of likely conflict for infrastructure
    development projects in southern Idaho, based on selected resource data themes of
    interest. These are the criteria used for ranking the input datasets: Low Conflict:
    Areas where adverse impacts from infrastructure development are expected to be minimal
    or can be reduced through minor siting adjustments and/or implementation of appropriate
    conservation or avoidance measures. In general, there are multiple options or wide
    latitude for reducing or minimizing conflict with the resource. In the Conflict
    Map model, resources of Low Conflict are assigned a conflict category value of 1.0.
    Moderate Conflict: Areas where adverse impacts from infrastructure development are
    likely but there are options for avoidance or reduction of impacts, including, in
    some cases, the use of timing or seasonal constraints. In the Conflict Map model,
    resources of Moderate Conflict are assigned a conflict category value of 2.0. High
    Conflict: Areas where adverse impacts from infrastructure development are likely
    and options for reducing or minimizing impacts are limited or non-existent. In the
    Conflict Map model, resources of High Conflict are assigned a conflict category
    value of 3.0. Development Precluded: Areas where infrastructure development is precluded
    by law, regulation or policy. In the Conflict Map model, areas where development
    is precluded are assigned a conflict category value of 100.0. Description of final
    conflict raster: Conflict category scores were summed across the various resource
    themes (input datasets) overlying specific areas. Areas with composite conflict
    category scores were mapped as: Low: Conflict Category Value total = 1.0-1.9 Moderate:
    Conflict Category Value total = 2.0-2.9 High: Conflict Category Value total = 3.0-
    99.9. This represents multiple high conflict datasets or combinations of resource
    issues. Development Precluded: Conflict Category Value total = 100-408. Colors grade
    from light gray (single area of Development Precluded, e.g. wilderness) to darker
    grays (overlapping Development Precluded areas, e.g. wilderness AND Visual Resource
    Management Class 1), and/or Development Precluded with other resource issues present
    (e.g. wilderness AND sage-grouse).",nt"license_title": null,nt"extras":
